// src/components/ManagerCampingList.js
import React from "react";

const ManagerCampingList = ({ tours, currentPage, totalPages, onPageChange }) => {
  if (!tours || tours.length === 0) {
    return <p className="text-center">Hiện chưa có địa điểm nào.</p>;
  }

  return (
    <>
      {tours.map((tour, index) => (
        <div
          className="col-xl-4 col-md-6"
          style={{ marginBottom: "30px" }}
          key={index}
        >
          <div className="destination-item tour-grid style-three bgc-lighter">
            <div className="image">
              {/* Badge trạng thái Active/In-progress */}
              {tour.status === "active" && (
                <span className="badge bgc-green">Active</span>
              )}
              {tour.status === "in-progress" && (
                <span className="badge bgc-yellow">Đang xem xét</span>
              )}

              <a href="#" className="heart">
                <i className="fas fa-heart"></i>
              </a>
              <img
                src={tour.thumbnail || "/images/no-image.jpg"}
                alt={tour.name || "Camping"}
                className="camping-img"
              />
            </div>

            <div className="content">
              <div className="destination-header">
                <span className="location">
                  <i className="fal fa-map-marker-alt"></i> {tour.address}
                </span>
                <div className="ratting">
                  {[1, 2, 3, 4, 5].map((i) => (
                    <i className="fas fa-star" key={i}></i>
                  ))}
                </div>
              </div>

              <h6>
                <a href={`/camping/${tour.id}`}>{tour.name}</a>
              </h6>

              <ul className="blog-meta">
                <li>
                  <i className="far fa-list"></i>{" "}
                  {tour.services?.length || 0} dịch vụ
                </li>
                <li>
                  <i className="far fa-clock"></i>{" "}
                  {new Date(tour.createdAt).toLocaleDateString("vi-VN")}
                </li>
              </ul>

              <div className="destination-footer">
                <span className="price">
                  {tour.basePrice?.toLocaleString("vi-VN")} VND / đêm
                </span>
                <a
                  href={`/camping/${tour.id}`}
                  className="theme-btn style-two style-three"
                >
                  <i className="fal fa-arrow-right"></i>
                </a>
              </div>
            </div>
          </div>
        </div>
      ))}

      {/* Pagination */}
      <div className="col-lg-12">
        <ul className="pagination justify-content-center pt-15 flex-wrap">
          <li className={`page-item ${currentPage === 1 ? "disabled" : ""}`}>
            <button
              className="page-link"
              onClick={() => onPageChange(currentPage - 1)}
            >
              <i className="far fa-chevron-left"></i>
            </button>
          </li>
          {Array.from({ length: totalPages }, (_, i) => i + 1).map((page) => (
            <li
              key={page}
              className={`page-item ${currentPage === page ? "active" : ""}`}
            >
              <button className="page-link" onClick={() => onPageChange(page)}>
                {page}
              </button>
            </li>
          ))}
          <li
            className={`page-item ${
              currentPage === totalPages ? "disabled" : ""
            }`}
          >
            <button
              className="page-link"
              onClick={() => onPageChange(currentPage + 1)}
            >
              <i className="far fa-chevron-right"></i>
            </button>
          </li>
        </ul>
      </div>
    </>
  );
};

export default ManagerCampingList;
